import React from 'react';
import styled from 'styled-components';
import LogoImage from '../images/logo-5.svg'; // Assurez-vous que le chemin est correct

const LogoContainer = styled.img`
  position: absolute;
  width: ${({ size }) => size || '100%'};
  top: ${({ top }) => top || '0'};
  left: ${({ left }) => left || '0'};
  transform: translate(-50%, ${({ top }) => top === '50px' ? '0%' : '-50%'});
  transition: width 1s ease, top 1s ease, left 1s ease, transform 1s ease;
  z-index: 100000001;
`;

const Logo = ({ size, top, left }) => {
  return <LogoContainer src={LogoImage} alt="Logo" size={size} top={top} left={left} />;
};

export default Logo;
